import { DashContentWrap } from '../../styles/components/Dashboard/DashContentStyle';
import DashHeader from './DashHeader';

export default function DashContent() {
    return (
        <DashContentWrap>
            <DashHeader ></DashHeader>
        </DashContentWrap>
    )
}
